webstoreListingDescription.message:
I-install ang extension ng AudD at mag-click sa icon nito para matukoy ang nagpe-play na kanta sa kasalukuyang tab.
Panoorin ang video sa itaas upang makita kung paano ito gumagana.

AudD extension:
- Kinikilala ang musikang tumutugtog sa iyong browser;
- Naghahanap ng musika sa AudD database na may higit sa 75 milyong mga kanta gamit ang teknolohiya ng pagkilala ng musika nito;
- Nagpapakita ng mga lyrics para sa mga natukoy na kanta;
- Nagpapakita ng mga link upang makinig sa mga kanta sa Apple Music, Spotify, Deezer, YouTube Music;
- Ipinapakita ang eksaktong sandali sa kinikilalang kanta kapag ang tunog mula sa browser ay nilalaro.

Music Recognition API: https://audd.io
Source code: https://github.com/AudDMusic/chrome-extension

Extension na Pinapatakbo ng AudD® Music recognition API

Ginawa at idinisenyo ng AudD.io team sa tulong nina Eric Stark, Mitchell Kossoris, at Ivan Kasatkin.
